import React from "react";

export function Detail(props){
    return (
        <div className="detail">
            <h1>{props.detalle.name}</h1>
            {props.detalle.weigth? <div>Peso aproximado: {props.detalle.weigth.metric}</div>: props.detalle.peso?<div>Peso aproximado: {props.detalle.peso}</div>: <span>sin datos de peso</span>}
            {props.detalle.height? <div>Altura aproximado: {props.detalle.height.metric}</div>: props.detalle.altura?<div>Altura aproximado: {props.detalle.altura}</div>: <span>sin datos de altura</span>}
            {props.detalle.life_span? <div>Vida aproximada: {props.detalle.life_span}</div>: props.detalle.añosvida?<div>Vida aproximada: {props.detalle.añosvida}</div>: <span>sin datos de vida</span>}
            {props.detalle.temperament? <div>Temperamento: {props.detalle.temperament}</div>: props.detalle.temperamentos?<div>Temperamentos {props.detalle.temperamentos.toString()}</div>: <span>sin datos de vida</span>}

        </div>
    )
}

export default Detail;
